E quanto ao jogo do Corinthians são 3 pontos perdidos pq não jogou com força máxima. De que adianta jogar melhor q o adversário com o time alternativo e perder de pouco. Melhor jogar muito melhor com o time titular e somar 3 pontos.

Dorival tem uma filosofia ridícula psra poupar.

